import pandas as pd
import pandas.api.extensions

class CustomArray(pd.api.extensions.ExtensionArray):
    def __init__(self, values):
        self._data = pd.array(values, dtype="int64")

    def __getitem__(self, item):
        return self._data[item]

    def __setitem__(self, key, value):
        self._data[key] = value

    def __len__(self):
        return len(self._data)

    @property
    def dtype(self):
        return CustomDtype()

    def take(self, indices, allow_fill=False, fill_value=None):
        from pandas.core.algorithms import take
        data = take(self._data, indices, allow_fill=allow_fill, fill_value=fill_value)
        return self._from_sequence(data)

    @classmethod
    def _from_sequence(cls, scalars, dtype=None, copy=False):
        return cls(scalars)

    def copy(self):
        return self._from_sequence(self._data.copy())

    @classmethod
    def _concat_same_type(cls, to_concat):
        data = pd.concat([x._data for x in to_concat])
        return cls(data)

class CustomDtype(pd.api.extensions.ExtensionDtype):
    @property
    def type(self):
        return int

    @property
    def name(self):
        return 'custom'

    @property
    def kind(self):
        return 'O'

    @classmethod
    def construct_array_type(cls):
        return CustomArray

# Register the custom array and dtype
pd.api.extensions.register_extension_dtype(CustomDtype)

# Create a DataFrame with the custom extension array
data = CustomArray([1, 2, 3, 4, 5])
df = pd.DataFrame({"custom": data})

